import base64
from PIL import Image
from io import BytesIO

# Sua string base64
base64_string = ""

# Decodifica a string base64 para obter os bytes da imagem
imagem_bytes = base64.b64decode(base64_string)

# Converte os bytes em um objeto de imagem usando o Pillow
imagem = Image.open(BytesIO(imagem_bytes))

# Exibe a imagem
imagem.show()
